import {ItemContainer} from './style'
function ItemRepo({repo}){
    return(
       <ItemContainer>
        <h3>{repo.name}</h3>
        <p>{repo.full_name}</p>
        <a href={repo.html_url} className="Remover"> ver repositorio</a>
        <br/>
        <a href="#"> Remover</a>
        <hr/>

       </ItemContainer>
    )
}



export default ItemRepo
